import React from 'react';

function Grid(props) {
  return (
    <div>
      {props.firstName} {props.lastName} has
      {props.role === 2 ? 'Payed' : 'Not Payed'}
      <button onClick={props.handleClick}>Activate</button>
    </div>
  );
}

export default Grid;
